        [TestMethod]
        public void TestIsDecentNumber()
        {
            Assert.IsFalse(Program.IsDecentNumber("33355555"));
            Assert.IsFalse(Program.IsDecentNumber("35"));
            Assert.IsFalse(Program.IsDecentNumber("133333555"));
            Assert.IsTrue(Program.IsDecentNumber("555"));
            Assert.IsTrue(Program.IsDecentNumber("33333"));
            Assert.IsTrue(Program.IsDecentNumber("53535333"));
            Assert.IsFalse(Program.IsDecentNumber("3355"));
        }
        [TestMethod]
        public void TestFirstInput()
        {
            Assert.AreEqual("-1", Program.LargestDecentNumber(1));
            Assert.AreEqual("555", Program.LargestDecentNumber(3));
            Assert.AreEqual("33333", Program.LargestDecentNumber(5));
            Assert.AreEqual("55555533333", Program.LargestDecentNumber(11));
        }

